import React from 'react'
import styles from './Header2.module.css';

export default function Header(props) {
    return (
        <div className={styles.headerBackground}>
            <div className={styles.container}>
                <div>
                    Etusivu</div>
                <div>    
                    HS Visio</div>
                
            </div>
        </div>
    )
}
